  namespace: Ubiquity.NET.Llvm.OrcJITv2
  summary: LLVM ORC JIT v2 custom materialization unit
  remarks: >-
    This is used for the bulk of "Lazy" JIT support. However, it is important to

    note that this class does not (and cannot) retain any instance data. All

    data used by the actual materialization is owned by the provided delegates or the

    <xref href="System.IDisposable" data-throw-if-not-resolved="false"></xref> implementation.
  example: []
  syntax:
    content: 'public sealed class CustomMaterializationUnit : MaterializationUnit, IDisposable'
    content.vb: Public NotInheritable Class CustomMaterializationUnit Inherits MaterializationUnit Implements IDisposable
