  summary: Initializes a new instance of the <xref href="Ubiquity.NET.Llvm.OrcJITv2.CustomMaterializationUnit" data-throw-if-not-resolved="false"></xref> class.
  remarks: >-
    This implementation will maintain the lifetime of the provided delegates via an internally allocated disposable

    until the materialization is completed or abandoned. If <code class="paramref">materializeAction</code> is not called, then

    the <code class="paramref">discardAction</code> is. This allows for cases where the data used by the <code class="paramref">materializeAction</code>

    is not held by the action itself or needs to support early disposal instead of remaining at the whims of the GC.
